import styled from "styled-components";
import { Link } from "react-router-dom";

const Header__upper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  position: absolute;
  width: 100%;
  height: 6rem;
  background-color: var(--cream);
  top: 0;
  border: 1px solid var(--border);
  box-sizing: border-box;
`;

const MainLogo = styled.img`
  width: 20px;
  height: 20px;
`;
const Menus = styled.ul`
  display: flex;
  justify-content: space-evenly;
  min-width: 10rem;
`;
const Menu = styled.li`
  font-size: 1.5rem;
  font-weight: 400;
  margin-right: 1.5rem;
  list-style: none;
`;

function Header() {
  return (
    <Header__upper>
      <Link to={"/"}>
        <MainLogo src="#" alt="Main Logo" />
      </Link>
      <Menus>
        <Menu>
          <Link to={"/introduction"}>클럽 소개</Link>
        </Menu>
        <Menu>
          <Link to={"/event"}>이벤트</Link>
        </Menu>
        <Menu>
          <Link to={"/"}>커뮤니티</Link>
        </Menu>
        <Menu>
          <Link to={"/"}>공지 사항</Link>
        </Menu>
        <Menu>
          <Link to={"/"}>문의하기</Link>
        </Menu>
        <Menu>
          <Link to={"/"}>마이페이지</Link>
        </Menu>
      </Menus>
    </Header__upper>
  );
}

export default Header;
